package cn.creditloans.tools.cache.datas;

import java.io.Serializable;

public class MemoryDatas implements Serializable{
	
	private static final long serialVersionUID = -4196032441096035733L;

	/**
	 * 所有正确数据
	 */
	private MemoryCorrectDatas corrects;
	
	/**
	 * 所有错误数据
	 */
	private MemoryErrorDatas errors;

	public MemoryCorrectDatas getCorrects() {
		return corrects;
	}

	public void setCorrects(MemoryCorrectDatas corrects) {
		this.corrects = corrects;
	}

	public MemoryErrorDatas getErrors() {
		return errors;
	}

	public void setErrors(MemoryErrorDatas errors) {
		this.errors = errors;
	}
	
}
